	(2, 100002, 'Computador Portátil LENOVO 15,6" Pulgadas IdeaPad Slim 3 Táctil - Intel Core i3 - RAM 8GB - Disco SSD 512GB - Gris', 'data:image/jpeg;base64,', 'En el portátil LENOVO IdeaPad Slim 3 color gris, encuentra todo el rendimiento que necesitas, un portátil accesible que cubre tus necesidades, su combinación generosa de memoria Ram y almacenamiento en estado solido, es perfecto para tus tareas diarias, con un diseño extraordinario, este equipo superará tus expectativas. Así mismo, te brindará un entretenimiento superior gracias a su sonido Dolby Audio, y te sentirás seguro gracias a su obturador de privacidad en su cámara, cuando termines tus reuniones o videollamadas solo tienes que cerrarlo. Aprovecha ¡lleva el tuyo ahora!', '1749000', 'Gris Artico', '82X7006WLM', '12 Meses', '	En Los computadores PORTATILES La duración de la batería es un valor aproximado y depende del uso que se le de al equipo. (Los computadores De escritorio NO tienen batería)', '15.6', 'Full HD', 2, 3, 1, 2, 1, 'Y'),
	(3, 100003, 'Computador Portátil ASUS Vivobook OLED 15,6" Pulgadas E1504 - AMD Ryzen 5 - RAM 8GB - Disco SSD 512 GB - Negro', 'data:image/jpeg;base64,', 'El potente ASUS Vivobook GO 15 negro brinda el máximo rendimiento gracias a su procesador Ryzen y los gráficos AMD Radeon Graphics. Su pantalla OLED NanoEdge validada por Pantone tiene hasta 600nits de brillo. Compacto y ligero de 1,6Kg. SSD PCIe 3.0. WiFi 6 ultrarrápido. Inicio de sesión seguro con sensor de huellas dactilares. Vivobook 15 OLED saca lo mejor de su creatividad gracias a las funciones avanzadas en la GPU que incluyen trazado de rayos, aceleración de IA y memoria LPDDR5 rápida. Cámara frontal de 720p HD. Sonido Sonic Master con cancelación de ruido. ¡Cómpralo ya!', '1749000', 'Negro mezclado', 'E1504FA-L1112W', '12 Meses', 'En Los computadores PORTATILES La duración de la batería es un valor aproximado y depende del uso que se le de al equipo. (Los computadores De escritorio NO tienen batería)', '15.6', 'Full HD', 1, 2, 2, 2, 2, 'Y');

